import React, { useState } from "react";
import "./style.css";

const AddProduct = () => {
  const [productName, setProductName] = useState("");
  const [description, setDescription] = useState("");
  const [availableQuantity, setAvailableQuantity] = useState("");
  const [productDate, setProductDate] = useState("");
  const [productImage, setProductImage] = useState("");
  const [typeOfCar, setTypeOfCar] = useState("");
  const [price, setPrice] = useState("");
  const [isSubmitClicked, setIsSubmitClicked] = useState(false);

  const handleSubmit = (event) => {
    event.preventDefault();
    setIsSubmitClicked(true);

    if (
      productName.trim() === "" ||
      description.trim() === "" ||
      availableQuantity.trim() === "" ||
      productDate.trim() === "" ||
      productImage.trim() === "" ||
      typeOfCar.trim() === "" ||
      price.trim() === ""
    ) {
      return; // لا تقم بمتابعة العملية إذا كان أي من الحقول فارغة
    }

    console.log({
      productName,
      description,
      availableQuantity,
      productDate,
      productImage,
      typeOfCar,
      price
    });

    setProductName("");
    setDescription("");
    setAvailableQuantity("");
    setProductDate("");
    setProductImage("");
    setTypeOfCar("");
    setPrice("");
    setIsSubmitClicked(false); // إعادة تعيين قيمة الضغط على الزر إلى القيمة الافتراضية
  };

  return (
    <div className="add-product-page">
      <div className="container">
        <div className="div">
          <div className="overlap-group">
            <div className="product-info">
              <div className="product-name">Product Name:</div>
              <input
                type="text"
                className={`input-box ${isSubmitClicked && productName.trim() === "" && "red-border"}`}
                value={productName}
                onChange={(e) => setProductName(e.target.value)}
                required
              />
              <div className="description">Description:</div>
              <input
                type="text"
                className={`input-box2 ${isSubmitClicked && description.trim() === "" && "red-border"}`}
                value={description}
                onChange={(e) => setDescription(e.target.value)}
                required
              />
              <div className="available-quantity">Available Quantity:</div>
              <input
                type="text"
                className={`input-box3 ${isSubmitClicked && availableQuantity.trim() === "" && "red-border"}`}
                value={availableQuantity}
                onChange={(e) => setAvailableQuantity(e.target.value)}
                required
              />
              <div className="product-date">Product Date:</div>
              <input
                type="date"
                className={`input-box ${isSubmitClicked && productDate.trim() === "" && "red-border"}`}
                value={productDate}
                onChange={(e) => setProductDate(e.target.value)}
                required
              />
            </div>
            <div className="product-details">
              <div className="type-of-car">Type Of Car:</div>
              <input
                type="text"
                className={`input-box4 ${isSubmitClicked && typeOfCar.trim() === "" && "red-border"}`}
                value={typeOfCar}
                onChange={(e) => setTypeOfCar(e.target.value)}
                required
              />
              <div className="price">Price:</div>
              <input
                type="number"
                className={`input-box5 ${isSubmitClicked && price.trim() === "" && "red-border"}`}
                value={price}
                onChange={(e) => setPrice(e.target.value)}
                required
              />
              <button
                type="submit"
                className="button"
                onClick={handleSubmit}
                disabled={isSubmitClicked && (
                  productName.trim() === "" ||
                  description.trim() === "" ||
                  availableQuantity.trim() === "" ||
                  productDate.trim() === "" ||
                  productImage.trim() === "" ||
                  typeOfCar.trim() === "" ||
                  price.trim() === ""
                )}
              >
               Add Product
              </button>
              {isSubmitClicked && ( // إظهار رسالة إذا تم الضغط على زر الإرسال ولم يتم ملء جميع الحقول
                <div className="error-message">
                  All fields are required.
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AddProduct;
